import React from 'react';
import './App.css';
import Nav from './Navbar';
import Main from './Main';
import Main_recent from './Main_recent';
import SideNav from './SideNav'
import { Container, Row, Col } from 'reactstrap';
import { BrowserRouter as Router, Route, Link } from "react-router-dom"


function App() {
  return (
    <div className="App">
      <Router>
      <Container fluid>
        <Row fluid>
          <Col style={{backgroundColor:"#E7133D"}}>
            <Nav fluid />
          </Col>
        </Row>
        <Row fluid>
            <Route path="/" exact component={Main_recent} />
            <Route path="/searchResults" exact component={Main} />
        </Row>
      </Container>
      </Router>
    </div>
  );
}

export default App;
